import React from 'react'

function AdminComponent() {


const uploadImage = async (files: any) => {
console.log(files[0])
const formData = new FormData()
formData.append("file", files[0])
formData.append("upload_preset","RecipeAppUserPhotos")
 try {
      const response = await fetch("https://api.cloudinary.com/v1_1/deewhii9n/image/upload", {
        method: "POST",
        body: formData,
      });

      if (response.ok) {
    
        const uploadedImage = await response.json()
        // Handle the successful response data as needed

        const imageUrl = uploadImage.secure_url
      } else {
        // Handle the error, e.g., throw an exception or log it
        console.error(`Failed to upload image. Status: ${response.status}`);
      }
    } catch (error) {
      // Handle other errors, e.g., network issues
      console.error("Error uploading image:", error);
    }
  };

  return (
    <div><form>
      <h2>Create New Recipe</h2>
      <input type='file' onChange={(event) => {
        uploadImage(event.target.files)
      }}></input>
       </form></div>
  )
}

export default AdminComponent
